    true,nt"url": null,nt"notes": "State-level data on all energy sources.
    Data include production, consumption, reserves, stocks, prices, imports, and exports.
    Data are collated from state-specific data reported elsewhere on the EIA website
    and are the most recent values available. The system provides data back from 1960.
    While some SEDS data series come directly from surveys conducted by EIA, many are
    estimated using other available information. These estimations are necessary for
    the compilation of "total energy" estimates.  Users of the EIA API are required
    to obtain an API Key via this registration form: http://www.eia.gov/beta/api/register.cfm",nt"license_title":
